  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:09.504455\",\n\t\"name\": \"abundance-and-distribution-of-seabirds-in-prince-william-sound\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Survey of birds from a five meter skiff,
  paralleling the shoreline 100 meters from shore along lands claimed by Natives and
  also along Forest Service and privately owned land. Black-legged Kittiwakes, Bonaoarte's
  Gulls, Glaucous-winged Gulls, Arctic Terns and Marbled Murrelets comprise the majority
  of the 17,384 birds sighted. Sea otters and harbor seals comprised the majority
  of the marine mammals. The areas with the densest numbers of birds were Galena Bay,
  Hinchinbrook Island, and the Port Fidalgo area including the outer coastline. Sheep
  Bay was the most important bay for marine mammals.\",\n\t\"license_title\": \"License
